import React from "react";
import "./Contact.css";

const Contact = () => {

  const [result, setResult] = React.useState("");

  const onSubmit = async (event) => {
    event.preventDefault();
    setResult("Sending....");
    const formData = new FormData(event.target);

    formData.append("access_key", "YOUR_ACCESS_KEY_HERE");

    const response = await fetch("https://api.web3forms.com/submit", {
      method: "POST",
      body: formData
    });

    const data = await response.json();

    if (data.success) {
      setResult("Form Submitted Successfully");
      event.target.reset();
    } else {
      console.log("Error", data);
      setResult(data.message);
    }
  };





  return (
    <div id="contact" className="contact">
      <div className="contact-title">
        <h1>Get in touch</h1>
        <img src="" alt="" />
      </div>
      <div style={{display:"flex" ,justifyContent:"space-evenly", alignItems:"center"}}>
      <div className="contact-section">
        <div className="contact-left">
          <h1>Let's talk</h1>
          <p>
            I am curruntly avalible to take on new project,so feel free to send
            me a message about anything that you want me to work on. You can
            contact anytime
          </p>
          <div className="contact-details">
            <div className="contact-detil">
              <img src="./img/email.png" alt="" />
              <p>adibkazi1106@gmail.com</p>
            </div>
            <div className="contact-detil">
              <img
                style={{
                  backgroundColor: "white",
                  height: "20px",
                  width: "20px",
                }}
                src="./img/phone-call.png"
                alt=""
              />
              <p>8007633650</p>
            </div>
            <div className="contact-detil">
              <img
                style={{
                  backgroundColor: "white",
                  height: "20px",
                  width: "20px",
                }}
                src="./img/location.png"
                alt=""
              />
              <p>Pune ,Maharastra</p>
            </div>
          </div>
        </div>
      </div>
      <from className="contact-right">
        <label htmlFor="">Your Name</label>
        <input type="text" placeholder="Enter your name" name="name" />
        <label htmlFor="">Your Email</label>
        <input type="email" placeholder="Enter Your Email" name="email" />
        <label htmlFor="">Write your messge here</label>
        <textarea
          name="message"
          rows="8"
          placeholder="enter your message"
        ></textarea>
        <button type="Submit" className="cotact-submit">
          Submit Now
        </button>
      </from>
      </div>
    </div>
  );
};

export default Contact;
